description:
Kleine kinderen houden van dieren en ze zullen het heerlijk vinden om de teletubbies te zien spelen met kleine en grote dieren.Op een dag in Teletubbieland ziet Laa-Laa een lammetje. Maar het lammetje is heel verdrietig...totdat er nog een lammetje komt en iedereen gelukkig is. Tinky WInky vindt het leuk een koe na te doen -- alsmaar weer! 
Po en alle andere Teletubbies zien een mooie vlinder en Dipsy komt een hele lieve hond tegen in Teletubbieland. En als de magische windmolen draait, zien de Teletubbies kinderen spelen met grote olifanten en kleine pinguins .. een zwanengezin en jonge hondjes... woef woef! 


